import { useState } from 'react';
import './App.css';

function App() {
  const [resp, setResp] = useState([])

  async function data() {
    try {
      await fetch('https://jsonplaceholder.typicode.com/todos/1')
        .then(response => response.json())
        .then(json => setResp(() => json))
    } catch(e) {
      console.log(e)
    }
  }


  return (
    <div className="App">
     {resp.map((json) => {
       return <p key={json.id}>json</p>
     })}
    </div>
  );
}

export default App;
